import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { Helmet } from 'react-helmet'
import { useForm } from 'react-hook-form';
import { useNavigate } from 'react-router-dom';

export const AdminDashBoard2 = () => {
    var style = {
        width: "90px"
    }
    var style1 = {
        visibility: "visible; animation-delay: 0.1s; animation-name: fadeInUp;"
    }
    var style2 = {
        visibility: "visible; animation-delay: 0.5s; animation-name: zoomIn;"
    }
   
    var style3 = {
        visibility: "visible; animation-delay: 0.1s; animation-name: fadeInUp;"
    }
    
    var style4 = {
        height: "250px"
    }
    
    var style5 = {
        height: "250px"
    }
    
    var style6 = {
        height: "48px"
    }
    
    var style7= {
        visibility: "visible; animation-delay: 0.1s; animation-name: fadeIn"
    }
     var style8={
        visibility: "visible; animation-delay: 0.3s; animation-name: fadeInUp"
     }
    const { register, handleSubmit } = useForm();
    var navigate = useNavigate()

    const [users, setusers] = useState()

    const submit = (data) => {

        console.log(data)
        axios.post("http://localhost:5000/project/project", data).then((res) => {
            console.log(res)
            getApi()
        }).catch((err) => {
            console.log(err)
        })


    };

    const getApi = () => {

        axios.get("http://localhost:5000/project/project").then((res) => {

            console.log(res.data.project)
            setusers(res.data.project)

        }).catch((err) => {

            console.log(err)
        })


    }
    useEffect(() => {

        getApi()
        navigate("/admindashboard")


    }, [])



    const updateProject = (id) => {
        axios.put("http://localhost:5000/project/project/" + id).then((res) => {
            getApi()
        }).catch((err) => {
            console.log(err);
        })
    }
    const deleteProject = (id) => {

        axios.delete("http://localhost:5000/project/project/" + id).then((res) => {


            getApi()



        }).catch((err) => {

            console.log(err)
        })
    }
    return (
        <div class='beckground'>
            <Helmet>
                <link href='https://unpkg.com/boxicons@2.0.9/css/boxicons.min.css' rel='stylesheet' />
                <link rel="stylesheet" href="https://unicons.iconscout.com/release/v4.0.0/css/line.css" />
                <link rel="stylesheet" href="../assets/vendor/fonts/jaymin.css" />
            </Helmet>
            {/* <section class="back"> */}
                {/* <div class='background' >
                    <form onSubmit={handleSubmit(submit)} >
                        <div class="col-12">
                            <div class="form-floating">
                                <label>title</label><br></br>
                                <input type="text" placeholder='Enter project title' {...register("title")} />
                            </div>
                        </div>
                        <div class="col-12">
                            <div class="form-floating">
                                <label>description</label><br></br>
                                <input type="text" placeholder='Descriotion of project' {...register("description")} />
                            </div>
                        </div>
                        <div class="col-12">
                            <div class="form-floating">
                                <label>technology</label><br></br>
                                <input type="text" placeholder='Project technology' {...register("technology")} />
                            </div>
                        </div>
                        <div class="col-12">
                            <div class="form-floating">
                                <label>estimatedHours</label><br></br>
                                <input type="number" placeholder='Time '{...register("estimatedHours")} />
                            </div>
                        </div>


                        {/* <div>
                        <label>createdAt_Date</label>
                        <input type="date" {...register("createdAt_Date")} />
                    </div>
                    <div>
                        <label>updatedAt_Date</label>
                        <input type="date" {...register("updatedAt_Date")} />
                    </div> */}
                        {/* <div class="col-12">
                            <input class="btn btn-primary w-100 py-3" type="submit" value="submit" />
                        </div> */}

                    {/* </form> */}
                    {/* <button onClick={getApi}>Get Api</button> */}
                {/* </div> */}



                <div class="container-xxl py-5">
            <div class="container px-lg-5">
                <div class="row justify-content-center">
                    <div class="col-lg-7">
                        <div class="section-title position-relative text-center mb-5 pb-2 wow fadeInUp" data-wow-delay="0.1s" style={style1}>
                            <h6 class="position-relative d-inline text-primary ps-4">Welcome to Login Page</h6>
                            <h2 class="mt-2">Please sign-in to your account and start the adventure</h2>
                        </div>
